import React from 'react';

function CardList({ cards }) {
  return (
    <div>
      <h2>Cartas cargadas</h2>
      <ul>
        {cards.map((card, index) => (
          <li key={index}>
            <h3>{card.name}</h3>
            <p>Tipo: {card.type}</p>
            <p>ATK: {card.attack} / DEF: {card.defense}</p>
            <p>Descripción: {card.description}</p>
            <p>Efecto: {card.effect ? 'Sí' : 'No'}</p>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default CardList;
